- input: "TEXT\x1CC00019331\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amended filing responds
    to the Commission's RFAIs of February 26 and March 24, 2010. Some transfers from
    the Democratic National Committee's State Partnership Program were incorrectly
    identified as proceeds from the WI Party Victory Fund joint fundraising program
    on the committee's June 2009 monthly through 2009 year-end reports. Records correction
    propagated errors in the reported year-to-date totals over this period. This amendment
    corrects those entries and makes consistent the reported year-to-date totals.
    \ Payroll related items on Schedule H4 of this report were for employees that
    spent 25% or less of their compensated time on Federal activity.    This report
    includes Memo Schedule A entries for contributions raised by the ASDC Partnership
    Program.  The committee has not received its share of the proceeds as of the end
    of the reporting period.  The committee expects to receive the transfer at some
    point in the three months following this reporting period.        This report
    includes Memo Schedule A entries for contributions raised by the WI Party Victory
    Fund programs.  The committee received a transfer for the majority of these funds
    during this period.  The committee expects to receive the remainder of this transfer
    at some point in the three months following this reporting period.  This report
    includes Memo Schedule A entries for contributions raised by the Dollars for Democrats
    Program.  The committee has not received its share of the proceeds as of the end
    of the reporting period.  The committee expects to receive the transfer at some
    point in the three months following this reporting period. Receipts on Schedule
    A, supporting Lines 15 and 17, were assessed at the usual and normal charge.  All
    fundraising related activity was for the benefit of the committee.\n"
